INSERT INTO `t_sys_email_template` VALUES ('new-company','myg','2021-01-29 08:35:47',1,NULL,'Welcome %company_name% to Sellixio - Your Partner in Success!',1,'Y','<p>Welcome&nbsp;aboard!&nbsp;We&nbsp;are&nbsp;delighted&nbsp;to&nbsp;have&nbsp;you&nbsp;join&nbsp;us&nbsp;at&nbsp;<strong>My&nbsp;Garage&nbsp;Solution</strong>.&nbsp;As&nbsp;you&nbsp;embark&nbsp;on&nbsp;this&nbsp;journey&nbsp;with&nbsp;us,&nbsp;we&nbsp;want&nbsp;to&nbsp;extend&nbsp;our&nbsp;warmest&nbsp;greetings&nbsp;and&nbsp;express&nbsp;our&nbsp;sincere&nbsp;appreciation&nbsp;for&nbsp;choosing&nbsp;us&nbsp;as&nbsp;your&nbsp;partner.</p><p></p><p>At&nbsp;<strong>My&nbsp;Garage&nbsp;Solution</strong>,&nbsp;we&nbsp;are&nbsp;committed&nbsp;to&nbsp;your&nbsp;success.&nbsp;Our&nbsp;mission&nbsp;is&nbsp;to&nbsp;empower&nbsp;businesses&nbsp;like&nbsp;yours&nbsp;with&nbsp;innovative&nbsp;solutions&nbsp;and&nbsp;unparalleled&nbsp;support&nbsp;to&nbsp;help&nbsp;you&nbsp;thrive&nbsp;in&nbsp;today&#39;s&nbsp;competitive&nbsp;landscape.<strong>&nbsp;</strong></p>','2025-06-30 12:55:26',1),('new-user','myg','2021-01-29 08:35:47',1,NULL,'Welcome to My Garage Solution',2,'Y','your user has been created. Please follow details below.',NULL,NULL),('contact-us','myg','2021-01-29 08:35:47',1,NULL,'Welcome to My Garage Solution',3,'Y','<p><strong>We\'re excited to have you get started. First, you need to confirm your account. Just press the button below.</strong></p>','2021-02-26 16:32:59',1),('myg-invoice','myg','2021-01-29 08:35:47',1,NULL,'My Garage Solution - Invoice',4,'Y','<p>I hope this message finds you well. Attached, please find the invoice for the <strong>my garage solutions</strong> subscriptions.</p><p>Please review the attached invoice and let us know if you have any questions or need further clarification regarding the charges.</p><p>If you have any inquiries or need assistance, feel free to reach out to us.</p><p>Thank you for your prompt attention to this matter. We sincerely appreciate your business and look forward to continuing our partnership.</p>','2023-12-14 12:54:17',1),('reset-password','myg','2021-01-29 08:35:47',1,NULL,'My Garage Solution: Reset your password',5,'Y','<p>You are receiving this email because we received a password reset request for your account. To proceed with the password reset please click on the button below:</p>','2022-11-08 20:37:13',1),('reset-password-success','myg','2021-01-29 08:35:47',1,NULL,'My Garage Solution: Reset your password successfully completed',6,'Y','<p>We wanted to inform you that your password has been successfully reset. You can now log in to your account using your new password.</p><p>If you did not request this password reset, please contact our support team immediately to ensure the security of your account.</p><p>Thank you for your attention to this matter.</p>','2024-07-30 19:08:30',1),('new-user','myg','2021-01-29 08:35:47',1,NULL,'My Garage Solution: Welcome User',7,'Y','<p><strong>We\'re excited to get you started!&nbsp;</strong></p><p><strong>Click the link below:</strong></p><p><a href=\"https://mygarage.solutions\"><strong>https://mygarage.solutions</strong></a></p><p><strong>Enter your user name &amp; password</strong></p><p><strong>Once logged in, you can change your password</strong></p>','2022-10-25 11:17:20',1);
